import React, { useState } from "react";
import { Link } from "react-router-dom";
import ModalVideo from "react-modal-video";
import "../Videos.css";
function Videos() {
  const [isOpen, setIsOpen] = useState(false);
  const [vId, setVid] = useState("");

  return (
    <div className="maincontainer">
      <div className="headline">
        <span>Videos</span>
      </div>
      {/* //////////start modal///////////// */}

      {/* ----------end modal-------------- */}

      <div className="viddiv">
        <ModalVideo
          channel="youtube"
          isOpen={isOpen}
          videoId="LQnAnxNkIrk"
          onClose={(e) => {
            setIsOpen(false);
          }}
          wmode="transparent"
          theme="dark"
        />
        <div>
          <img
            alt="pic"
            src="//i1.ytimg.com/vi/LQnAnxNkIrk/mqdefault.jpg"
            className="img-responsive"
            onClick={(e) => {
              setIsOpen(true);
              setVid(e.target.videoId);
            }}
          />

          <p className="galeritext">
            Cocktailbar Casablanca bei Gilani≈õ Auf Livestyle Teil1: Equipment
          </p>
        </div>
        {/* <p className="galeritext">{`${drink.cname} Lernvideo`}</p> */}
      </div>

      <div>
        <button className="btngreen" type="submit">
          <Link
            to="/suche"
            className="Pagelink"
            onClick={() =>
              window.scroll({ top: 0, left: 0, behavior: "smooth" })
            }
          >
            Cocktail Generator
          </Link>
        </button>
      </div>
    </div>
  );
}

export default Videos;
